import React, {FC} from 'react';
import Layout from 'components/global/layout';
import EditPost from 'api/PublicTransportAPIs/editpostAPI';
import EditPostContext from 'api/context/PublicTransportContext/EditPostContext';
import './styles.scss';

interface IProps {};

export const Editpost: FC<IProps> = () => (
  <Layout title="EditPost" description="This is the EditPost Page">
    <EditPostContext.Provider>
     <EditPost />
   </EditPostContext.Provider>
  </Layout>
);

export default Editpost;
